$(document).ready(function(){var a=$("#job_history_tbl").DataTable({sAjaxSource:ws_path+"history",sAjaxDataProp:"",aoColumns:[{mData:function(b){return'<a href="'+job_info_path+b.id+'">'+b.name+"</a>"}},{mData:"algoType"},{mData:"creationTime"},{mData:"status"}],columnDefs:[{render:function(b){return moment(b).format("MMM DD, YYYY hh:mm:ss A")},targets:[2]}],rowCallback:function(d,c,b){switch(c.status){case"Failed":$(d).addClass("danger");break;case"Cancel":$(d).addClass("warning");break;case"Finished":$(d).addClass("success");break}},order:[[2,"desc"]]})});